script: |
  super -f text -I q3593.spq | sort > q3593.out

inputs:
  - name: q3593.spq
    data: |
      SELECT col2 * col2 AS col2 FROM tab1 (FORMAT parquet) WHERE NULL BETWEEN - col2 * + col2 AND - - CAST ( ( - - col0 ) AS INTEGER ) - CAST ( - col2 AS INTEGER );
  - name: tab1

outputs:
  - name: q3593.out
    data: |
